import React from "react";
import DefaultOperationProps from "./DefaultOperationProps";
import PaymentFormComponent from "./PaymentFormComponent";
const DisplayOperations = ({operation,data}) => {
    const AllOperations = {
        payment: <PaymentFormComponent data={data} />
    }
    if (operation === '') return null;
    let propDefault = Object.keys(DefaultOperationProps[operation]);
    let propDefaultList = Object.keys(DefaultOperationProps[operation]);

    for (let x = 0; x < propDefaultList.length; x ++) {
        if (!Object.keys(data).toString().includes(propDefaultList[x])) {
            data[propDefaultList[x]] = propDefault[propDefaultList[x]];
        }
    }
    return operation === '' ? null : AllOperations[operation];
}
export default DisplayOperations;
